import { Dialog } from "@mui/material";
import React from "react";

const dialogStyle={
    height: "95%",
    width: "100%",
    margin: "20px",
    borderRadius: "none",
    maxWidth: "100%",
    maxHeight: "100%",
    boxShadow: "none",
}

const ChatDialog=()=>{
    return (
        <Dialog open={true} PaperProps={{sx: dialogStyle}} hideBackdrop>
            Hello from chat
        </Dialog>
    );
}

export default ChatDialog;
